package com.shangji.business.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2019-05-06 上午10:53:39 * @version: V 1.0 */public class Code extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     * 手机号     */    private String phone ;    /**     * 验证码     */    private String code ;    /**     *      */    private java.util.Date createTime ;    /**     *      */    private java.util.Date updateTime ;    public String getPhone(){        return this.phone;    }    public void setPhone(String phone){        this.phone=phone;    }    public String getCode(){        return this.code;    }    public void setCode(String code){        this.code=code;    }    public java.util.Date getCreateTime(){        return this.createTime;    }    public void setCreateTime(java.util.Date createTime){        this.createTime=createTime;    }    public java.util.Date getUpdateTime(){        return this.updateTime;    }    public void setUpdateTime(java.util.Date updateTime){        this.updateTime=updateTime;    }}